  constructor(props) {
    super(props);
    this.state = {
      topPicks: null,
      districtName: "Jaipur",
      showLoader: true,
      season: "Summer",
    };
  }

  componentDidMount() {
    this.fetchCrop(this.state.districtName);
  }

  changeState = stateName => {
    this.props.changeState(stateName);
  };

  handleSeason = event => {
    this.setState(
      {
        season: event.target.value,
        districtName: this.state.districtName,
      },
      () => {
        this.fetchCrop(this.state.districtName);
      }
    );
  };
  fetchCrop = state_district => {
    this.setState(
      {
        showLoader: true,
      },
      () => {
        console.log(" Show loader : ", this.state.showLoader);
        axios
          .post(API_FETCH_PREDICTIONS, {
            season: this.state.season,
            district: state_district,
            state: "Rajasthan",
          })
          .then(res => {
            console.log("Response", res);
            if (res) {
              this.setState(
                {
                  topPicks: res.data,
                  districtName: state_district,
                  showLoader: false,
                },
                () => {
                  console.log("Top picks : ", this.state.topPicks);
                }
              );
            }
          })
          .catch(err => {
            console.log(err);
            this.setState(
              {
                showLoader: false,
              },
              () => console.log(" Show loader : ", this.state.showLoader)
            );
          });
      }
    );
  };

